window.bookSummaryJSON = "<p><b>** SAVE BIG WITH THIS BOX SET **</b></p> <p><b><i>NOBODY HAS EVER HEARD OF ODIN...<br> ODIN IS ABOUT AS SECRET AS A GOVERNMENT AGENCY CAN GET...</i></b></p> <p>Books Included:</p> <ul> <li>Odin (Book 1)</li> <li>Ice Cold Spy (Book 2)</li> <li>Mason's Law (Book 3)</li> </ul> <p><b>Multiple time </b><b><i>USA TODAY</i></b><b> &amp; Amazon 5-million copy bestselling authors DAVID ARCHER and BLAKE BANNER have combined forces to create one hell of a thriller series!</b></p> <p>Because within ODIN there is General Operations, which speaks for itself; ODIN 5i, which deals with intelligence gathering, and then there is ODIN 1i which deals in operations so sensitive not even the CIA can touch them. All three are run with an iron first by The Chief, a giant with a gigantic IQ. His top agent is Alex Mason, hard and cool – he's a law unto himself.</p> <p>But when an ODIN 5i agent based at the US Embassy in Manila, goes missing, and his encrypted laptop disappears with him, the whole ODIN structure is put in peril. Then the agents he was managing start to disappear one by one, and things start to look ugly.</p> <p>So Alex Mason is sent to Manila, and what he finds there is the growing shadow of Chinese imperialism threatening not only America’s presence in the Pacific, but the security of the whole Western World…</p> <p>This is a job for ODIN 1i.</p> <p>And for Alex Mason.</p>"; 
